import Button from "../elements/Button";
import MowingHours from "../inputs/MowingHours";

const Step5 = ({ whichStep, setWhichStep, handleChange, buttonClick }) => {
  return (
    <div className="main container-inputs">
      <h2>Step5</h2>
      <ul className="inputs" id="inputs">
        <li className="column range with-output">
          <MowingHours {...{ handleChange, buttonClick }} />
        </li>
      </ul>
      <Button {...{ whichStep, setWhichStep }} />
    </div>
  );
};

export default Step5;
